import React, { useState } from "react";
import ReactPaginate from "react-paginate";

const Pagination = ({ pageCount, changePage }) => {
  const [values] = useState([
    {
      value: "10"
    },
    {
      value: "15"
    },
    {
      value: "20"
    },
    {
      value: "25"
    },
    {
      value: "30"
    }
  ]);

  return (
    <div className="pagination">
      <select name="noOfUsers" id="noOfUsers">
        {values.map((items) => (
          <option
            key={items.value.toString()}
            value={items.value}
            // onSelect={handleSelect(items.value)}
          >
            {items.value}
          </option>
        ))}
      </select>
      <ReactPaginate
        previousLabel={"<"}
        nextLabel={">"}
        onPageChange={changePage}
      />
    </div>
  );
};

export default Pagination;
